module.exports = "<div class=\"container-fluid\">\n  <div class=\"py-5\">\n    <div class=\"container my-5\">\n      <div class=\"row mx-auto\">\n        <div class=\"col-md-12 text-light text-center\">\n          <h1 class=\"mb-3\">Senior Design\n            <br>\n          </h1>\n          <div class=\"card text-gray\">\n            <!-- Project One -->\n            <div class=\"text-gray\">\n              <div class=\"card-body\">\n                  <h3><a href=\"http://sdmay19-36.sd.ece.iastate.edu/docs.html\">Website</a></h3>\n                  <hr>\n                <h3>Definition</h3>\n                <p>Our Senior Design project focuses on keeping elderly seniors inside their home.\n                  To do this, we will implement a sensor network and utilize a wearable (such as a smart watch)\n                  to track the senior's activity, and identify when the senior does an activity (such as make\n                  breakfast).\n                  When an activity is identified, this will be logged to develop a character profile of the senior.\n                  That way,\n                  eventually if the senior does not follow along their regular schedule, their caretakers and family\n                  members will\n                  be notified.\n\n                  Our project will inherit previous design projects. As a result, the scope of our project has been\n                  limited to\n                  three things: Implementing a smart-plug tracking system, a on-senior device wearable tracking system,\n                  and a guest tracking\n                  system. These will then need to be integrated into current back-end environment.\n\n                  Our hope is that our project can help seniors stay in their homes longer, and also alert the senior's\n                  caretakers and family\n                  member's if something goes wrong. Our hope is that by tracking if the senior is following their\n                  regular schedule,\n                  we can alert caretakers before something goes wrong.\n                </p>\n                <h3>Contribution</h3>\n                <p>For our senior design project, I am the GitLab administrator. I am in charge\n                  of keeping the repository polished, and ensuring all team members are adding their code in a way\n                  that does not harm the overall repository. I am also tasked with implementing the smart-plug's API.\n                </p>\n                <h3>Skills Utilized & Learned</h3>\n                <p>So far, we have utilized my previous experience with back-end services and APIs.\n                  Particularly with NodeJS and javascript. We will also learn how to integrate with\n                  a variety of sensors provided from the chosen smart watch. If we decide with an Apple Watch,\n                  we will learn how to use Swift, and XCode, and developing an iOS watch app and iPhone app to send\n                  the tracked data. We will also learn how to use the Java Spring framework, as the current back-end\n                  runs on Spring.\n                </p>\n                <hr>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>"

